import React from "react";
import "./Project.css";

const projects = ({ id }) => {
  console.log("id", id);
  return (
    <div className="wrapper">
      <div>
        <h1 id={id} style={{ fontSize: 50, color: "white" }}>
          Projects
        </h1>
      </div>
    </div>
  );
};

export default projects;
